import React from "react";

const images = [
        './assets/blue.png',
        './assets/pink.jpg',
        './assets/plain.png',
        './assets/rasberry.png',
        './assets/sugar.png'
        ];

function Card(props) {
    return images.map((item) => (
        <div className='card'
            key={item.i}
            style={{backgroundImage: `url(${item})`}}
        >
        </div>
    ));
}

export default Card;
